import React from 'react'
import './Weather.css'

const Weather = ({weather}) => {
    const timeFormater = (sec) => {
        const time = new Date(sec * 1000)
        const hours  = time.getHours()
        const minutes= time.getMinutes()
        return `${hours} : ${minutes}` 

    }


    const MonthHaddler = (time) => {
        const options = { day: 'numeric', month: 'long' };
       const formattedDate = time.toLocaleDateString('ru-RU', options);
       return `${formattedDate}`;
    }



    const kelvinToCelsius = (kelvin) => {
        return kelvin - 273.15; 
      };


  return (

    <div className=' weather-we-1f'>
    <div className='weather-const'>
    {
        weather && weather.cod !== '200' ?

        <div className='weather'>
         <h1 className='h1-w1'>{weather.name}, {weather.sys.country}</h1>

         <p className='pop-w1'>{timeFormater(weather.dt)} {MonthHaddler(new Date(weather.dt * 1000))}</p>
         <img className='img-w3' src={`http://openweathermap.org/img/w/${weather.weather[0].icon}.png`} />
         <h2 className='h2-w4'>{kelvinToCelsius(weather.main.temp).toFixed(0)}°C</h2>
         {/* <p>{weather.weather[0].description}</p> */}
        <div className='sys-set-rise'>
        <p className='po-w6'>Sunrise <i class="fa-solid fa-mountain-sun" style={{marginLeft: '-79px', marginTop: '20px' ,position: 'absolute', color: '#fff', fontSize: '20px'}}></i> <h3 className='git-e9'>{ timeFormater(weather.sys.sunrise)}</h3></p>
        <p className='po-w7'>Sunset<h3><i class="fa-solid fa-mountain-sun" style={{marginLeft: '-23px'}}></i>{ timeFormater(weather.sys.sunset)}</h3></p>
        </div>
        <hr/>
        <div className='sys-Wind-Like'>
        <p className='po-w6-e'>Wind<i class="fa-solid fa-wind" style={{marginLeft: '-60px', marginTop: '20px' ,position: 'absolute', color: '#fff', fontSize: '20px'}} ></i> <h3>{weather.wind.speed}m/s</h3></p>
         <p className='po-w7'>FEELS LIKE:<h3>{kelvinToCelsius(weather.main.feels_like).toFixed(0)}°C</h3></p>
         </div>
         <hr />
         <p>Ressure: {weather.main.pressure}гПа</p>
         <p>Humidity: {weather.main.humidity}%</p>
         <p>Сloudy: {weather.clouds.all}%</p>


      </div>
      :
      <></>
    }


    </div>
    </div>
  )
}

